#include <bits/stdc++.h>
using namespace std; ifstream fin("biminprim.in"); ofstream fout("biminprim.out"); int mini = 1000000; bool prim(int n){ int cnt = 0; for(int d = 1; d * d <= n; ++d){ if(n % d == 0) cnt+=2; if(d * d == n) cnt--; } if(cnt == 2) return 1; return 0; } void citire(int nod){ int x; fin >> x; if(x < mini && prim(x)) mini = x; if(x != 0){ citire(2 * nod); citire(2 * nod + 1); } } int main(){ int x; fin >> x; citire(2); int s; if(mini != 1000000) s = mini; else s = -1; mini = 1000000; citire(3); int s1; if(mini != 1000000) s1 = mini; else s1 = -1; fout << s << ' ' << s1; return 0; }
